import React, {useState} from 'react'
import { Card, ListGroup, ListGroupItem, Form, Button, Row, Col } from 'react-bootstrap';
import { Application } from './export';
import { faTimes, faSearch} from '@fortawesome/free-solid-svg-icons'
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { useDispatch, useSelector } from 'react-redux';
import { sendToMessage } from '../actions/authActions';
import { sendToBill } from '../actions/billAction';
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css"
import 'react-datepicker/dist/react-datepicker-cssmodules.min.css'

const Bill = (props) => {
    const allUser = useSelector((state) => state.auth ? state.auth.allUser : null)

    const [show, setShow] = useState(false);
    const [editDisplay, setEditDisplay] = useState("none");
    const [payDisplay, setPayDisplay] = useState("none");
    const [message, setMessage] = useState()


    const handleClose = () => setShow(false);
    const handleShow = () => setShow(true);

    const dispatch = useDispatch()
    // const userEmail = "123@gmail.com";
    console.log("props.value", props.value);
    const [billInfo, setBillInfo] = useState({
        user: props.value ? props.value : null,
        currency: "EUR",
        description: "",
        amount: "",
        date: new Date()
    })

    const currencies = ["EUR", "GBP", "INR", "RMB", "Bitcoin"]
    let currencyOption = currencies.map((item, index) => {
        return <option value={item} key={index}>{item}</option>
    });

    const handleChange = event => {
        const target = event.target;
        const value = target.type === 'checkbox' ? target.checked : target.value;
        setBillInfo({...billInfo, currency: value})
    }

    const onSubmit = async () => {
        console.log("on submit bill", billInfo);
        // await dispatch(sendToBill(billInfo))
    }

    const toggleEditDisplay = () => {
        if(editDisplay === "none"){
            setEditDisplay("display")
        }else{
            setEditDisplay("none")
        }
    }

    // const send = async () => {
    //     const currentUser = allUser.filter((a) => a.nickname === props.value)
    //     console.log("currentUser",currentUser[0]);
    //     console.log("send message to user", message, props.value);
    //     const messageInfo = {sendTo: currentUser[0].username, message}
    //     console.log("messageInfo", messageInfo);
    //     // await dispatch(sendToMessage(messageInfo))
    // }

    var dd = billInfo.date.getDate();
    var mm = billInfo.date.getMonth() + 1; // 0 is January, so we must add 1
    var yyyy = billInfo.date.getFullYear();

    var dateString = dd + "/" + mm + "/" + yyyy;

    return (
        <>
            <h6>Send To: {props.value} | {allUser ? allUser.filter((a) => a.nickname === props.value)[0].username : null}</h6>
                <Form.Group controlId="formBasicDescription">
                    <Form.Label>Description: </Form.Label>
                    <Form.Control value={billInfo.description} onChange={(e) => setBillInfo({ ...billInfo, description: e.target.value })} type="text" placeholder="" />
                </Form.Group>
            <div className="form-group">
                <label htmlFor="currency">Default Currency</label>
                <select
                    name="currency"
                    id="currency"
                    value={billInfo.currency}
                    className="form-control"
                    onChange={handleChange}>
                    {currencyOption}
                </select>
            </div>
            <Form.Group controlId="formBasicDate">
                <Form.Label>Amount: </Form.Label>
                <Form.Control value={billInfo.amount} onChange={(e) => setBillInfo({ ...billInfo, amount: e.target.value })}type="text" placeholder="" />
            </Form.Group>
            <Form.Group controlId="formBasicDate">
                <Form.Label>Due Date: </Form.Label><br/>
                <DatePicker selected={billInfo.date} onChange={date => setBillInfo({...billInfo, date})} />
            </Form.Group>
            <Row>
                <Button variant="primary" onClick={onSubmit} style={{width: "70%", margin: "0 auto"}}>
                    Send
                </Button>
                {/* <Col>
                    <Button variant="secondary" onClick={toggleEditDisplay} style={{width: "100%"}}>
                        Message
                    </Button>
                </Col> */}
            </Row>
            {/* <Application.Base display = {editDisplay}>
                <Application.Close toggleDisplay={toggleEditDisplay}><FontAwesomeIcon icon={faTimes} /></Application.Close>
                <h6>Message</h6>
                <Application.TextArea value={message} onChange={(e) => setMessage(e.target.value)}/>
                <Button variant="secondary" onClick={send} style={{width: "100%"}}>
                        Send Message
                </Button>
            </Application.Base> */}
        </>
    );
}

export default Bill
